(39, 511492065, 'Ngọc Rồng Sao Đã Open Test', '<p><a href=\"file:///C:/Users/Admin/Downloads/fasfasaaaaaa.png\"><img alt=\"\" src=\"https://ibb.co/51jpQh4\" /><img alt=\"\" src=\"file:///C:/Users/Admin/Downloads/fasfasaaaaaa.png\" /></a><img alt=\"\" src=\"https://ibb.co/51jpQh4\" /><img alt=\"\" src=\"https://ibb.co/51jpQh4\" /><img alt=\"????\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t84/1/16/1f381.png\" style=\"height:16px; width:16px\" />HO&Agrave;N TO&Agrave;N MIỄN PH&Iacute;<img alt=\"????\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t84/1/16/1f381.png\" style=\"height:16px; width:16px\" /></p>\r\n\r\n<p>- Set k&iacute;ch hoạt c&oacute; thể treo tại Gohan Nhật Nguyệt</p>\r\n\r\n<p>- D&ugrave;ng đồ thần linh, huỷ diệt, thi&ecirc;n sứ để n&acirc;ng cấp s&eacute;t k&iacute;ch hoạt vip</p>\r\n\r\n<p>- C&oacute; bộ skill mới cực k&igrave; mạnh</p>\r\n\r\n<p>- Bảng nhiệm vụ mới lạ hấp dẫn</p>\r\n\r\n<p>- Hứa hẹn tạo 1 thị trường s&ocirc;i động</p>\r\n\r\n<p>- Nhiều chức năng mới cập nhật theo thời gian</p>\r\n\r\n<p>- Đội ngũ admin hỗ trợ người chơi tận t&igrave;nh v&agrave; tiếp thu &yacute; kiến g&oacute;p &yacute; của người chơi</p>\r\n\r\n<p>- Cộng đồng game đ&ocirc;ng đảo, c&ugrave;ng nhau gi&uacute;p đỡ l&agrave;m nhiệm vụ, săn boss...</p>\r\n\r\n<p>- Trang chủ: <a href=\"https://nroking.com/?fbclid=IwAR3YP94QB9hTj8qAOCH7Ls2lNhrfG55V9kDorbdiL-LyPnTAawJCV5C2dG8\" target=\"_blank\">https://nroking.com/</a></p>\r\n\r\n<p>- Fanpage ch&iacute;nh thức: <a href=\"https://www.facebook.com/nroking123?__cft__[0]=AZUZ0GmQTUH-81UgAo79q6kGF8-WWKdGF_73nMR-BRxAKOhGwGV_lRyPHO-114x3_2O0NWr1H5HutsUdxnXMhin6Bc1fwQoytjEloqslshlnFCK9N2omsFrrFvAsErHLQMr_kS0tcyBjj_gm1LZDeVmt0vtc6bmk8OQFN6n1uFTLnDFanfX2KtCV6L9RrIfNs6s&amp;__tn__=-]K-R\">facebook.com/nroking123</a></p>\r\n\r\n<p>- Box Ch&aacute;t Zalo: <a href=\"https://zalo.me/g/xygsoz606?fbclid=IwAR1BLyjshyB4fj3EaFm4PzSMQQgW2s3RZgo3yPUQXxkuGVf00bocND5bjL4\" target=\"_blank\">https://zalo.me/g/xygsoz606</a></