(834, 7473, 2, 120, 0, 7, '[]', 'Thẻ Thằn lằn bay', 'Thằn lằn bay dùng cái mỏ dài và cứng để tấn công kẻ thù, đôi khi chúng vẫn dùng để gõ hạt óc chó ăn', '[{\"id\":77,\"param\":1,\"activeCard\":0},{\"id\":77,\"param\":2,\"activeCard\":1},{\"id\":77,\"param\":3,\"activeCard\":2}]', 833, 2, -1),
